// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract StakingContract {
    IERC20 public stakingToken;
    uint256 public rewardRatePerSecond = 1e18; // Rewards per second per token (example value)
    mapping(address => uint256) public balances; // Track user deposits
    mapping(address => uint256) public rewardDebt; // Rewards accrued but not withdrawn
    mapping(address => uint256) public lastStakedTime; // Last time user interacted with the contract

    constructor(IERC20 _stakingToken) {
        stakingToken = _stakingToken;
    }

    /// @notice Deposit tokens for staking
    /// @param amount The amount of tokens to stake
    function deposit(uint256 amount) external {
        require(amount > 0, "Amount must be greater than 0");

        // Update rewards for the sender before changing balances
        _updateRewards(msg.sender);

        // Transfer the staking tokens to this contract
        stakingToken.transferFrom(msg.sender, address(this), amount);

        // Update user balance and last interaction time
        balances[msg.sender] += amount;
        lastStakedTime[msg.sender] = block.timestamp;
    }

    /// @notice Withdraw staked tokens and claim rewards
    /// @param amount The amount of tokens to withdraw
    function withdraw(uint256 amount) external {
        require(amount > 0, "Amount must be greater than 0");
        require(balances[msg.sender] >= amount, "Insufficient balance");

        // Update rewards for the sender before changing balances
        _updateRewards(msg.sender);

        // Update the user balance
        balances[msg.sender] -= amount;

        // Transfer the staking tokens back to the user
        stakingToken.transfer(msg.sender, amount);
    }

    /// @notice Claim accumulated rewards without withdrawing tokens
    function claimRewards() external {
        _updateRewards(msg.sender);

        // Get the rewards owed
        uint256 rewards = rewardDebt[msg.sender];
        require(rewards > 0, "No rewards to claim");

        // Reset the rewards debt after claiming
        rewardDebt[msg.sender] = 0;

        // Transfer rewards to the user (assumes rewards are in the same token)
        stakingToken.transfer(msg.sender, rewards);
    }

    /// @notice Internal function to update rewards for a user
    /// @param user The user whose rewards are being updated
    function _updateRewards(address user) internal {
        uint256 timeElapsed = block.timestamp - lastStakedTime[user];
        uint256 pendingAmount = balances[user] * rewardRatePerSecond * timeElapsed / 1e18; // Renamed variable

        // Add the pending rewards to the user's rewardDebt
        rewardDebt[user] += pendingAmount;

        // Reset the last staked time
        lastStakedTime[user] = block.timestamp;
    }

    /// @notice View function to check pending rewards for a user
    /// @param user The user's address
    /// @return Pending rewards
    function pendingRewards(address user) external view returns (uint256) {
        uint256 timeElapsed = block.timestamp - lastStakedTime[user];
        uint256 pending = balances[user] * rewardRatePerSecond * timeElapsed / 1e18;
        return rewardDebt[user] + pending;
    }
}

interface IERC20 {
    function transferFrom(address sender, address recipient, uint256 amount) external returns (bool);

    function transfer(address recipient, uint256 amount) external returns (bool);
}

